import Header from "../../components/Header/Header";
import Footer from "../../components/Footer/Footer";

const ProfilePage = () => {
  const dummyUser = {
    user_name: "Player123",
    school_id: 123456,
    grade: "7",
  };
  return (
    <>
      <Header />
      <div className="profile-page">
        <div className="profile-card">
          <h2>My profile</h2>

          <div className="profile-info">
            <p>
              <strong>Username:</strong> {dummyUser.user_name}
            </p>
            <p>
              <strong>School code:</strong> {dummyUser.school_id}
            </p>
            <p>
              <strong>Grade:</strong> {dummyUser.grade}
            </p>
          </div>
        </div>
      </div>
    </>
  );
};

export default ProfilePage;
